A '''cyclops''' (plural ''cyclopes'') is a large one-eyed [[monster]]. They are known for dropping many [[Alchemy spells|alchable]] drops, so bringing [[nature rune|nature]] and [[fire rune]]s is helpful as it allows players to make longer trips and more money without banking or taking up inventory space.

Cyclopes may be killed as a substitute for [[hill giant]]s on a [[Slayer task]].

