==Defenders==
{{Main|Defender}}

Cyclopes in the [[Warriors' Guild]] have a rare chance of dropping a [[defender]]. These defensive weapons range from [[Bronze defender|bronze]] to [[Dragon defender|dragon]] and must be obtained in order, starting with bronze, by killing cyclopes on the top floor of the Warriors' Guild and then showing the defender to [[Kamfreena]] outside the chamber. Once a player earns the rune defender, they can enter the basement of the Warriors' Guild and kill the stronger cyclopes found there for a chance at the dragon defender. As this is located in the Warriors' Guild, cyclopes found in these areas are immune to [[Ranged]] and [[Magic]] attacks and must be fought with melee combat.

